function Expenses(props) {
    const expenses = [
        {
            id: 'e1',
            date: new Date(2003, 10, 2),
            title: 'Car',
            amount: 3000
        },
        {
            id: 'e1',
            date: new Date(2023, 9, 13),
            title: 'Ghee',
            amount: 30
        },
        {
            id: 'e1',
            date: new Date(2021, 12, 1),
            title: 'Soap',
            amount: 50
        },
        {
            id: 'e1',
            date: new Date(2010, 5, 12),
            title: 'Bag',
            amount: 100
        }
    ];
    return (
        <div className="expenses">
            <div>{expenses[0].title} {expenses[0].amount} {expenses[0].date}</div>
            <div>{expenses[1].title} {expenses[1].amount} {expenses[1].date}</div>
            <div>{expenses[2].title} {expenses[2].amount} {expenses[2].date}</div>
            <div>{expenses[3].title} {expenses[3].amount} {expenses[3].date}</div>
        </div>
    );
}
export default Expenses;
